commits.sourceNew:
/**
 * Creates a new payload with the the given array as data.
 * 
 * @param data the data of this payload
 */
public Payload(byte[] data) {
  this(data, 0, data.length);
}

/**
 * Creates a new payload with the the given array as data.
 * A reference to the passed-in array is held, i. e. no 
 * copy is made.
 * 
 * @param data the data of this payload
 */
public Payload(byte[] data) {
  this(data, 0, data.length);
}

